import { Component } from '@angular/core';
import { Validators, FormBuilder } from '@angular/forms';

@Component({
  selector: 'app-card-contatos',
  templateUrl: './card-contatos.component.html',
  styleUrls: ['./card-contatos.component.css']
})
export class CardContatosComponent {
  longText = `The Shiba Inu is the smallest of the six original and distinct spitz breeds of dog
  from Japan. A small, agile dog that copes very well with mountainous terrain, the Shiba Inu was
  originally bred for hunting.`;


  constructor(private _formBuilder: FormBuilder) {}
}
<mat-card class="example-card">
  <mat-card-header>
    <mat-card-title>Jhonatan W Faelis</mat-card-title>
    <mat-card-subtitle>Lead quente</mat-card-subtitle>
  </mat-card-header>
  <mat-card-content>
    <p>jhonatanFaelis@gmail.com</p>
    <p> (19) 99926-5677</p>
    <p>13/07/1995</p>
    <p>R$ 3.500,00</p>
  </mat-card-content>
  <mat-card-actions class="justify-content-end">
    <button mat-button class="btn btn-danger"><i class="bi bi-pencil-square"></i></button>
    <button mat-button><i class="bi bi-card-list"></i></button>
    <button mat-button><i class="bi bi-trash3"></i></button>
  </mat-card-actions>
</mat-card>
